import React from "react"
import Highcharts from 'highcharts/highcharts-gantt.src'
import { HighchartsChart, PieSeries, Series, withHighcharts, XAxis, YAxis, Title } from "react-jsx-highcharts";


export function RenderPieChart(props) {

  const data = [
    {
      y: 10,
      name: "Work orders",
      color: "#3498db",
      displayY: 10
    },
    {
      y: 18,
      name: `Affected`,
      color: '#e67e22',
      displayY: 18
    },
    {
      y: 25,
      name: `Monitored`,
      color: '#1abc9c',
      displayY: 25
    },
  ];

  return (

    <HighchartsChart
      pie
      plotOptions={{
        pie: {
          size: 40,
          dataLabels: {
            enabled: false
          }
        }
      }}
      chart={{
        width: 80,
        height: 80,
        backgroundColor: 'transparent',
      }}
    >

      <XAxis
        id={"pie-chart-xaxis"}
      />
      <YAxis
        id={"pie-chart-yaxis"}
      >
        <Series
          type="pie"
          data={props.data}
        />
      </YAxis>
    </HighchartsChart>

  );

}

export default withHighcharts(RenderPieChart, Highcharts);
